import axios from "axios";
import {
  getAllServicesUrl,getAllAchievementsUrl
} from "./ApiUrls";

//                                       service requests

// getAllServices

export const fetchAllServices = () =>
  axios
    .get(getAllServicesUrl, {
      Accept: "application/json",
      "Content-Type": "application/json",
    })
    .then((res) => res.data);


